import React, { Component } from "react";
import './card.scss'
import $ from 'jquery'

export default class Services extends Component {
    constructor(props){
      super(props)
    }

  componentDidMount = () =>{

      $('ul.cards').on('click', function(){
        $(this).toggleClass('transition');
      });

      $('ul.card-stacks').on('click', function(){
        $(this).toggleClass('transition');
      });

      $('ul.cards-split').on('click', function(){
        $(this).toggleClass('transition');
      });

      $('ul.cards-split-delay').on('click', function(){
        $(this).toggleClass('transition');
    });

  }

  render() {
    return (
      <div>

ul.card-stacks
  li.title
    h2 Expand to grid
  li.stack.stack-1
    ul.cards-down
      li.card.card-1
        img(src="http://lorempixel.com/401/250/city")
        div.content
          h1 Card 1 Title
          p Stack 1
      li.card.card-2
        img(src="http://lorempixel.com/401/250/food")
        div.content
          h1 Card 2 Title
          p Stack 1
      li.card.card-3
        img(src="http://lorempixel.com/401/250/animals")
        div.content
          h1 Card 3 Title
          p Stack 1
  li.stack.stack-2
    ul.cards-down
      li.card.card-1
        img(src="http://lorempixel.com/402/250/city")
        div.content
          h1 Card 1 Title
          p Stack 2
      li.card.card-2
        img(src="http://lorempixel.com/402/250/food")
        div.content
          h1 Card 2 Title
          p Stack 2
      li.card.card-3
        img(src="http://lorempixel.com/402/250/animals")
        div.content
          h1 Card 3 Title
          p Stack 2
  li.stack.stack-3
    ul.cards-down
      li.card.card-1
        img(src="http://lorempixel.com/403/250/city")
        div.content
          h1 Card 1 Title
          p Stack 3
      li.card.card-2
        img(src="http://lorempixel.com/403/250/food")
        div.content
          h1 Card 2 Title
          p Stack 3
      li.card.card-3
        img(src="http://lorempixel.com/403/250/animals")
        div.content
          h1 Card 3 Title
          p Stack 3

     </div>
    );
  }
}
